import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import CoverPage                from './../../components/CoverPage/CenterTitle';
import RisksAndVantages         from './../../components/Contents/RisksAndVantages';
import IntroHow                 from './../../components/Contents/IntroHow';
import TextWithImageHorizontal  from './../../components/Contents/TextWithImageHorizontal';
import CallToActionPharse       from './../../components/Contents/CallToActionPharse';

class Services extends Component {

  constructor( props )
  {

    super();

    let texts = getLanguage('de-de');

    this.state = {
      texts: texts
    }

  }

  render() {

    let { texts }  = this.state;
    let page_texts = texts.page_services;

    return (
      <div>

        <Header
          menu_texts      = {texts.header}
          languages_texts = {texts.all_languages}
          actual_language = {texts.language}        />

        <CoverPage />

        <IntroHow />
        <RisksAndVantages />

        <TextWithImageHorizontal
          title="Genius IA"
          description="asiod jasiod asoid jasiod aso doasdj soaj dasj doasj dioasj dioasj diosaj dioasj doasj dioasj dasdj asiodj asiod jasodij as"
          label="Inteligencia Artificial"
          float="left" />

        <TextWithImageHorizontal
          title="AIKA"
          description="asiod jasiod asoid jasiod aso doasdj soaj dasj doasj dioasj dioasj diosaj dioasj doasj dioasj dasdj asiodj asiod jasodij as"
          label="Automatizador"
          float="right" />

        <TextWithImageHorizontal
          title="Ferramenta de Apoio a Tomada de Decisao"
          description="asiod jasiod asoid jasiod aso doasdj soaj dasj doasj dioasj dioasj diosaj dioasj doasj dioasj dasdj asiodj asiod jasodij as"
          label="ProboGraph"
          float="left" />

        <TextWithImageHorizontal
          title="Painel Transparente"
          description="asiod jasiod asoid jasiod aso doasdj soaj dasj doasj dioasj dioasj diosaj dioasj doasj dioasj dasdj asiodj asiod jasodij as"
          label="GlassPanel"
          float="right" />

        <CallToActionPharse />

        <Footer
          footer_texts = {texts.footer} />

      </div>
    );
  }
}
export default Services;
